import React from 'react'
import experience from './data/dataExperience'
import { Icon } from '@iconify/react';
function Experience() {
  return (
    <>
    <section id='experience' className='experience-section'>
      <div>
      <div className='exp-title'>
      <h1>Experience</h1>
      </div>
      <div className='exp-card-group'>
        {experience.map((curElem)=>{
          const{id,title,type,company,timePeriod,location,skill,exp}=curElem;
          return(
            // <div className='exp-card' key={id}>
            //   <div>
            //   <br /><span className='exp-company'>{company}</span>
            //   <span className='exp-last'>{timePeriod}</span>
            //   <br />
            //   {location}
            //   <span className='exp-last'>{skill}</span></div>
            // </div>
            <>
            <div className='exp-card' key={id}>
            
              <div className='exp-card-grp'>
              <p className='exp-card-left'>{title}</p>
              <span className='exp-card-type'>{type}</span>
              </div>
              <div className='exp-card-grp'>
              
              <Icon icon="heroicons:building-office-2" width="25" height="25" />
              {company}
              <Icon icon="tdesign:location" width="20" height="20" /> {location}
              <Icon icon="uil:calender" width="20" height="20" />{timePeriod}
              </div>
              <div className=''>{skill}</div>
              <div className=''>{exp}</div>
            </div>
            </>
          )
        })}
      </div>
      </div>
    </section>
    </>
  )
}

export default Experience
